import React from 'react';

const Page = () => {
    const items = ["国内", "北京", "上海", "深圳", "天津", "杭州", "成都", "国外", "圣保罗", "雅加达"];

    const groupedItems = [];
    for (let i = 0; i < items.length; i += 8) {
        groupedItems.push(items.slice(i, i + 8));
    }

    return (
        <div className='k-social-index-page'>
            <div className="social social-index-banner"></div>
            <div className="social-index-filters">
                <div className="k-common-filters">
                    <div className="k-common-filters-title">工作地点</div>
                    <div className="k-common-filters-items-row">
                        <div className="k-common-filters-items">
                            {groupedItems.map((group, index) => (
                                // 将 groupedItems 中的 item 分别放进不同的item中
                                <div key={index} className="group"> 
                                    {group.map((item, itemIndex) => (
                                        <div key={itemIndex} className='item'>{item}</div>
                                    ))}
                                </div>
                            ))}
                            <div className="k-common-filters-items-expand"></div>
                        </div>
                    </div>
                </div>
            </div>
            <div className="social-index-search"></div>
            <div className="social-index-table"></div>
        </div>
    );
};

export default Page;
